    playbackData.comments = {"1c141f9c-e96e-4431-a360-cce8de633b2b":[{"id":"e82948bc-3574-4360-96b7-2136f5b1a55a","displayCommentEventId":"1c141f9c-e96e-4431-a360-cce8de633b2b","displayCommentEventSequenceNumber":0,"developerGroupId":"1a7f9117-b25a-4b17-ae40-8b0637233abe","timestamp":1729705187237,"commentText":"A playback introducing factors in terms of limiting and graphing factors in a particular order.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"612fa9a1-83a7-4b0b-846a-0908647a65cd":[{"id":"4b201058-3d45-4632-bf47-a8f1f8c7f700","displayCommentEventId":"612fa9a1-83a7-4b0b-846a-0908647a65cd","displayCommentEventSequenceNumber":259,"developerGroupId":"04eea454-6436-4a88-a121-a18aef7d8e87","timestamp":1729708069294,"commentText":"The data we are looking at today are beverage reviews of beverages of different styles.&nbsp; The data includes the name of the beverage, style of beverage, a description of the beverage, some measurements about it, and the reviewer's scores of the beverages.&nbsp; A snapshot of the data is shown below.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1729708064316-beer1.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/factors.R","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"ee208452-0ed9-4736-9b26-c12357102fbf":[{"id":"3ba014a7-dda6-4dad-9970-46ab03fba37f","displayCommentEventId":"ee208452-0ed9-4736-9b26-c12357102fbf","displayCommentEventSequenceNumber":382,"developerGroupId":"04eea454-6436-4a88-a121-a18aef7d8e87","timestamp":1729708092493,"commentText":"When we first look at the beer<span style=\"font-family: Courier;\"> Style</span> column, we notice that the styles are formatted in the following way:<div><br></div><div><span style=\"font-family: Courier;\">broadCategory - specificCategory</span></div><div><br></div><div>Because we already have a lot of data and a lot of different styles, it might be nice to take only the broad category of beverage and place it in another column.&nbsp; To do this, we split our strings at the hyphen and take only the first part, placing the end result in the new <span style=\"font-family: Courier;\">style</span> column (it might have been better to pick a different word, so as not to confuse this column with the<span style=\"font-family: Courier;\"> Style</span> column, but alas).</div><div><br></div><div>As a general reminder, remember that functions/actions we perform on strings generally start with the <span style=\"font-family: Courier;\">str_ </span>prefix.&nbsp; The same pattern will hold when working with factors.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/factors.R","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"c521777d-9d3d-437f-b015-f1c23575fa6e":[{"id":"f55a4b90-77b9-4127-a8ba-4289aa5b42a4","displayCommentEventId":"c521777d-9d3d-437f-b015-f1c23575fa6e","displayCommentEventSequenceNumber":439,"developerGroupId":"04eea454-6436-4a88-a121-a18aef7d8e87","timestamp":1729728680627,"commentText":"After cleaning the <span style=\"font-family: Courier;\">Style</span> column, we can more appropriately categorize the styles of the beverages. To see how many (clean) styles there are, and how often they are represented in our data, we can count the number of styles.&nbsp; To try to display them all, we can print a large number of them to the screen.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1729728668658-beer125.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/factors.R","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"9b488b96-f230-4c67-b1f0-bf752ee9aa92":[{"id":"f1e5c29c-3463-4d80-af0f-c3fe9e7bf6f5","displayCommentEventId":"9b488b96-f230-4c67-b1f0-bf752ee9aa92","displayCommentEventSequenceNumber":553,"developerGroupId":"04eea454-6436-4a88-a121-a18aef7d8e87","timestamp":1729729359881,"commentText":"We've discussed categorical values before, and the variables in the style column are categorical variables.&nbsp; Whether or not a variable is categorical is a job for a person to determine, not a computer, but it is nice to be able to communicate to the computer that a variable is categorical.&nbsp; R represents categorical variables as the data type <span style=\"font-style: italic;\">factor.</span>&nbsp;<div><br></div><div>In our next playback, we will learn more about the specifics of what R needs to create / cast variables as factors, but for today, we will look at helper functions in R for organizing and grouping factors.&nbsp; The first function we see here is <span style=\"font-family: Courier;\">fct_lump_lowfreq()</span>.&nbsp;&nbsp;</div><div><br></div><div>The <span style=\"font-family: Courier;\">fct_lump_lowfreq() </span>function takes a vector of values that contain categorical data and reduces the number of categories by lumping together rare categories into a single category called <span style=\"font-family: Courier;\">Other</span>.&nbsp;&nbsp;</div><div><br></div><div>The next two functions we learn will do the same general thing, but how we determine which categories become grouped together in the <span style=\"font-family: Courier;\">Other</span> category will differ.&nbsp; <span style=\"font-family: Courier;\">fct_lump_lowfreq()</span> groups together as many low frequency categories as it can while <span style=\"font-weight: bold;\">ALSO</span> guaranteeing that the <span style=\"font-family: Courier;\">Other</span> category will remain the smallest category.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/factors.R","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"543a6825-a1b4-454a-bb08-cc87cb82f371":[{"id":"cceeb406-2586-4aef-b745-94f9231fabfb","displayCommentEventId":"543a6825-a1b4-454a-bb08-cc87cb82f371","displayCommentEventSequenceNumber":611,"developerGroupId":"04eea454-6436-4a88-a121-a18aef7d8e87","timestamp":1729729439658,"commentText":"Because we still don't know the number of categories, we still choose to print a lot of rows to make sure we see them all.&nbsp; The results of the <span style=\"font-family: Courier;\">fct_lump_lowfreq()</span> function are shown below, with the <span style=\"font-family: Courier;\">Other </span>category highlighted.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1729729433374-beer15.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/factors.R","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"3423e579-2521-42c6-9ba9-b2e0b71ed53f":[{"id":"2208a2bd-dc51-48c0-acbf-279e8a8a411a","displayCommentEventId":"3423e579-2521-42c6-9ba9-b2e0b71ed53f","displayCommentEventSequenceNumber":783,"developerGroupId":"04eea454-6436-4a88-a121-a18aef7d8e87","timestamp":1729729777155,"commentText":"It might be nice to dictate the number of categories we find acceptable.&nbsp; Using <span style=\"font-family: Courier;\">fct_lump_n()</span> allows us to specify a value for <span style=\"font-family: Courier;\">n</span>, where <span style=\"font-family: Courier;\">n</span> is the number of categories we wish to allow (ish).&nbsp; In reality, there will be <span style=\"font-style: italic;\">n + 1</span> categories, as the <span style=\"font-family: Courier;\">Other</span> category will be one additional category.&nbsp;&nbsp;<div><br></div><div>Note that this function behaves as we might hope it would, taking the<span style=\"font-style: italic;\"> n</span> largest categories from the column and grouping all remaining categories into <span style=\"font-family: Courier;\">Other</span>.<div><br></div><div><br></div></div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/factors.R","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"c570fb80-3241-4d94-8b16-409084a1627d":[{"id":"83d867fc-0e14-4f1f-a8b6-494affd1b3ef","displayCommentEventId":"c570fb80-3241-4d94-8b16-409084a1627d","displayCommentEventSequenceNumber":842,"developerGroupId":"04eea454-6436-4a88-a121-a18aef7d8e87","timestamp":1729729826611,"commentText":"Here is the output print by these two lines of code.&nbsp; Notice one potential downside of this method: the <span style=\"font-family: Courier;\">Other</span> category is quite large!","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1729729799233-beer2.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/factors.R","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"2f7ed49e-d97c-4958-8c6c-65768b1c287c":[{"id":"db6b70e7-0890-470d-bd64-ae2a0c65bfc6","displayCommentEventId":"2f7ed49e-d97c-4958-8c6c-65768b1c287c","displayCommentEventSequenceNumber":1009,"developerGroupId":"04eea454-6436-4a88-a121-a18aef7d8e87","timestamp":1729729854205,"commentText":"Yet another way we may wish to choose which categories become lumped together for<span style=\"font-family: Courier;\"> Other</span> is by us dictating their size.&nbsp; When we use<span style=\"font-family: Courier;\"> fct_lump_min(),</span> we pass in the vector of categorical values and a minimum value, indicating that all categorize with size less than the minimum value be lumped together to form the <span style=\"font-family: Courier;\">Other</span> category.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/factors.R","viewableBlogText":"","commentTags":["question"],"questionCommentData":{"allAnswers":["True","False"],"correctAnswer":"False","question":"True of False: With <span style=\"font-family: Courier;\">fct_lump_min()</span>, we can tell ahead of time how many values our categorical variable can take on.","explanation":""}}],"2d4ac2a5-3241-430a-82a9-ac9badc73e2b":[{"id":"c140f109-28ae-4f85-9b07-54db3b2a00cc","displayCommentEventId":"2d4ac2a5-3241-430a-82a9-ac9badc73e2b","displayCommentEventSequenceNumber":1068,"developerGroupId":"04eea454-6436-4a88-a121-a18aef7d8e87","timestamp":1729737382287,"commentText":"Because we don't know how many categories there will be, we again choose a large <span style=\"font-family: Courier;\">n</span> value to pass to the&nbsp;&nbsp;<span style=\"font-family: Courier;\">print() </span>function to be sure we see them all.&nbsp; The output of this code is shown below, with the <span style=\"font-family: Courier;\">Other</span> category highlighted.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1729737372297-beer3.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/factors.R","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"79802661-2ae4-4cac-adb1-d43da6b8772f":[{"id":"9a20e284-4290-43d1-b37c-ced09f047a20","displayCommentEventId":"79802661-2ae4-4cac-adb1-d43da6b8772f","displayCommentEventSequenceNumber":1187,"developerGroupId":"04eea454-6436-4a88-a121-a18aef7d8e87","timestamp":1729737447837,"commentText":"The biggest reason we may wish to minimize the number of values a categorical variable can take on is due to graphing.&nbsp; If we have too many categories, graphs can be difficult to read, or even misleading.&nbsp; Let's look at some examples with this data for clarity.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/factors.R","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"9ca549bd-f9c5-42cf-9336-06f0a5c1923e":[{"id":"fb089f75-b321-4143-a3e9-b9e667d79d74","displayCommentEventId":"9ca549bd-f9c5-42cf-9336-06f0a5c1923e","displayCommentEventSequenceNumber":1244,"developerGroupId":"04eea454-6436-4a88-a121-a18aef7d8e87","timestamp":1729737564939,"commentText":"Imagine we wish to create a bar chart that looks at how many beverages we have in each style category, to perhaps get a feel for a most popular type of beverage.&nbsp; The image below shows what happens if we just ask for this bar chart with what we have currently in the <span style=\"font-family: Courier;\">style</span> column.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1729737547766-beerg1.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/factors.R","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"003184c8-4d1c-4a9f-a819-35bc1142e119":[{"id":"fa8ca33e-91e5-405a-ae62-645c39fe0917","displayCommentEventId":"003184c8-4d1c-4a9f-a819-35bc1142e119","displayCommentEventSequenceNumber":1311,"developerGroupId":"04eea454-6436-4a88-a121-a18aef7d8e87","timestamp":1729737803705,"commentText":"When graphing with factors, we can use the <span style=\"font-family: Courier;\">fct_infreq()</span> function to sort the factor categories according to how frequent they are.&nbsp; The <span style=\"font-family: Courier;\">fct_infreq()</span> function takes in a vector of categorical variables (a vector of factors) and returns a sorted version of them with the most populous categories first.&nbsp; This makes a difference in our graph as shown below:","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1729737706998-beerg2.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/factors.R","viewableBlogText":"","commentTags":["image","question"],"questionCommentData":{"allAnswers":["It would be better sorted least frequent to more frequent","The x-axis is illegible","The scale on the y-axis  is not particularly meaningful","Several of these things"],"correctAnswer":"Several of these things","question":"While this graph is better, what is undesirable about this graph?","explanation":""}}],"ff8a3fd2-cf4a-4639-9a29-2155a413305a":[{"id":"69fb2464-94b5-4977-ba3f-d26ad9b9185f","displayCommentEventId":"ff8a3fd2-cf4a-4639-9a29-2155a413305a","displayCommentEventSequenceNumber":1340,"developerGroupId":"04eea454-6436-4a88-a121-a18aef7d8e87","timestamp":1729738102609,"commentText":"In applying <span style=\"font-family: Courier;\">fct_lump_n() </span>to our data before graphing, we ensire there are only <span style=\"font-style: italic;\">n+1 </span>bars in the chart.&nbsp; This means we can actually see the style labels on the <span style=\"font-style: italic;\">x</span>-axis AND that the <span style=\"font-style: italic;\">y</span>-values are more meaningful because they more closely relate to the largest categories.<div><br></div><div>The downside here is that <span style=\"font-family: Courier;\">Other</span> is the largest category, since it is a combination of so many of them lumped together.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1729737960009-beerg3.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/factors.R","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}]};
